import React from 'react';
import P5Wrapper from 'react-p5-wrapper';
import sketch from './draw-sketch';
class DrawMap extends React.Component{
  render() {
    return (
          <div onClick={this.onGameClick} style={{display: 'flex', justiftContent: 'center', alignItems: 'center', width: '50%', height: '40px', color: 'white'}}>
          Draw
          <P5Wrapper sketch={sketch} color={this.state.color}></P5Wrapper>
      </div>
      );
  }
}
export default DrawMap;
